trailingComments.value:
*
 *  话题详情页完成回调
 *
 *  支持平台：书旗iOS
 *
 *  @return 0：传入参数解析失败 1：传入参数解析成功
 *
 *  @example
 *  const params = {
 *   imgUrl: 'http://img-tailor.11222.cn/pm/book/operate/2018101614200305.jpg',
 *   title: '官宣❤想和赵丽颖说恭喜的！进！',
 *   shareUrl: 'http://d.shuqi.com/10_3sxJ1',
 *  };
 *  lib.exec('call-app-talk-detail-page-finish', {
 *    params,
 *  }).then((info) => {
 *    alert(`[call-app-talk-detail-page-finish][info] ${JSON.stringify(info, null, 2)}`);
 *  }).catch((err) => {
 *    alert(`[call-app-talk-detail-page-finish][error] ${JSON.stringify(err, null, 2)}`);
 *  });

